import React from "react";

function Navbar() {
  return (
    <nav className="flex items-center justify-between px-10 py-6 bg-white shadow-sm fixed w-full top-0 z-50">
      <div className="flex items-center gap-3">
        <img
          src="/assets/images/profile-icon.png"
          alt="Logo"
          className="w-8 h-8 rounded-full"
        />
        <h1 className="font-bold text-lg text-gray-800">Arie Pratama</h1>
      </div>
      <ul className="flex gap-8 text-gray-700 font-medium">
        <li className="hover:text-blue-600 cursor-pointer">About</li>
        <li className="hover:text-blue-600 cursor-pointer">Skills</li>
        <li className="hover:text-blue-600 cursor-pointer">Portfolio</li>
        <li className="hover:text-blue-600 cursor-pointer">Contact</li>
      </ul>
    </nav>
  );
}

export default Navbar;
